package binarySearch.LongestDuplicateSubstring_1044;

import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class SolutionTest {
    @Test
    public void test() {
        Solution s = new Solution();
        assertEquals("ana", s.longestDupSubstring("banana"));
        assertEquals("nana", s.longestDupSubstring("nanana"));
        assertEquals("nana", s.longestDupSubstring("nanana"));
        assertEquals("akyj", s.longestDupSubstring(""));
        assertEquals("aeeebaabd", s.longestDupSubstring(""));
    }
}